import Vue from 'vue';
import PieChart from '../Charts/PieChart.vue';

export default Vue.extend({
    name: "OverviewSourced",
    components: {
        PieChart,
    },
    data() {
        return {
            chart: {
                loaded: true,
                data: {
                    labels: ["Portal", "ITViec", "Facebook"],
                    datasets: [{
                        data: [10, 2, 0],
                        backgroundColor: ['#333', 'red', 'blue'],
                    }],
                },
                options: {
                    responsive: true,
                    legend: {
                        display: false,
                    }
                }
            }
        }
    }
});
